// [1, 2, 3, 4, 5, 6] -> [[1, 2], [3, 4], [5, 6]]
function chunk(arr, size) {
    var myArray = [];
    for (var i = 0; i < arr.length; i += size) {
        myArray.push(arr.slice(i, i + size));
    }
    return myArray;
}

// { x, y } -> lat
function rdToLat(coord) {
    var { x, y } = coord;
    var p = (x - 155000.00) / 100000;
    var q = (y - 463000.00) / 100000;
    var df = (
        (q * 3235.65389) +
        (p * p * -32.58297) +
        (q * q * -0.24750) +
        (p * p * q * -0.84978) +
        (q * q * q * -0.06550) +
        (p * p * q * q *-0.01709) +
        (p * -0.00738) +
        (p * p * p * p * 0.00530) +
        (p * p * q * q * q *-0.00039) +
        (p * p * p * p * q *0.00033) +
        (p* q * -0.00012)
    ) / 3600;

    return (Math.round((52.15517440 + df) * 100000000.00)) / 100000000.00;
}

// { x, y } -> lng
function rdToLng(coord) {
    var { x, y } = coord;
    var p = (x - 155000.00) / 100000;
    var q = (y - 463000.00) / 100000;
    var dl = (
        (p * 5260.52916) +
        (p * q * 105.94684) +
        (p * q * q * 2.45656) +
        (p * p * p * -0.81885) +
        (p * q * q * q * 0.05594) +
        (p * p * p * q * -0.05607) +
        (q * 0.01199) +
        (p * p * p *q * q * -0.00256) +
        (p * q * q *q * q * 0.00128) +
        (q * q * 0.00022) +
        (p * p * -0.00022) +
        (p * p * p * p * p * 0.00026)
    ) / 3600;

    return (Math.round((5.387206210 + dl) * 100000000.00)) / 100000000.00;
}

// "1 2 3 4 5 6" -> [ { lat: xxx, lng: yyy}* ]
function convert(coordString) {
    var coordArray = coordString.split(" ").map(x => Number(x));
    return chunk(coordArray, 2)
        .filter(function(item, pos, arr) {
            return pos === 0 || item !== arr[pos-1];
        })
        .map(arr => ({ x: arr[0], y: arr[1] }))
        .map(coord => {
            var lat = rdToLat(coord);
            var lng = rdToLng(coord);

            return ({ lat, lng });
        });
}

// init Google Maps
function initMap() {
    var map = new google.maps.Map(document.getElementById('map'), {
        zoom: 10,
        center: { lat: 52.91149304, lng: 5.40137557 },
        mapTypeId: 'roadmap',
//        mapTypeId: 'satellite',
//        mapTypeId: 'hybrid',
//        mapTypeId: 'terrain',
    });

    coordStrings
        .map(convert)
        .map(coords => new google.maps.Polygon({
            paths: coords,
            strokeColor: '#FF0000',
            strokeOpacity: 0.8,
            strokeWeight: 2,
            fillColor: '#FF0000',
            fillOpacity: 0.35
        }))
        .forEach(poly => poly.setMap(map));
}
